import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Grid from '@material-ui/core/Grid';
import Card from '@material-ui/core/Card';
import CardContent from '@material-ui/core/CardContent';
import Typography from '@material-ui/core/Typography';
import {
  Col,
  Form,
  FormGroup,
  Input,
  Label,
  Row,
} from 'reactstrap';
import Chip from '@material-ui/core/Chip';
import Title from 'components/Title/CardTitle';

const useStyles = makeStyles(theme => ({
  root: {
    width: '100%',
    '& > * + *': {
      marginTop: theme.spacing(2),
    },
  },
  chiproot: {
    display: 'flex',
    justifyContent: 'center',
    flexWrap: 'wrap',
    padding: theme.spacing(0.5),
},
chip: {
    margin: theme.spacing(0.5),
},
}));

export default function PatientAlert(props) {
  const classes = useStyles(props);

  return (
    <div className={classes.root}>
            <Card className={classes.cardroot} style={props.height}>
                    <CardContent>
                        <Typography className={classes.title} color="primary" gutterBottom>
                            Allergies
                        </Typography>
                            <Grid container spacing={12}>
                                <Grid item xs='12'>
                                    <Typography className={classes.pos} color="textSecondary" >

                                      <div className={classes.allergiesroot}>
                                    <Chip
                                          label="Pencline"
                                          color="secondary"
                                          variant="outlined"
                                      />
                                      <Chip
                                          label="Nut Shirm"
                                          color="secondary"
                                          variant="outlined"
                                      />
                                      <Chip
                                          label="Deletable secondary"
                                          color="secondary"
                                          variant="outlined"
                                      />

                                      </div>
                                    </Typography>
                                </Grid>      
                            </Grid> 
                            <Form>
                            <Card >  

                                <CardContent>

                                        <Row form>
                                            <Col md={4}>
                                            <FormGroup>

                                                <Input type="text" name="phoneNumber" id="phoneNumber" placeholder="Phone Number"  />
                                            </FormGroup>
                                            </Col>
                                            <Col md={4}>
                                            <FormGroup>
                                                <Label for="altPhoneNumber">Alt. Phone Number</Label>
                                                <Input type="text" name="alternatePhoneNumber" id="alternatePhoneNumber" placeholder="Alternative Number" />
                                            </FormGroup>
                                            </Col>

                                        </Row>


                                </CardContent> 
                                </Card> 
                                </Form>                            
                    </CardContent>                      
            </Card>
    </div>
  );
}
